                        <option>Bizeps</option>
                        <option>Trizeps</option>
                        <option>Schultern</option>
                    </select>
                </form> */}
                <div>
                    {exercises.map((exercise) => {
                        <ExerciseContainer
                        key={exercise.id}
                        name={exercise.name}
                        muscle={exercise.muscle}
                        type={exercise.type}
                        description={exercise.description}
                        />
                    })}
                </div>
            </div>
        </Fragment>
     );
}

export default Exercises;
